import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

const rows = [
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
];

export default function BasicTable() {
  return (
    <div style={{marginTop: '80px', marginLeft: '120px', marginRight: '120px' }}>
    <TableContainer component={Paper}>
      <Table style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}} aria-label="simple table">
        <TableHead style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>
          <TableRow style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>
            <TableCell style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>Codigo</TableCell>
            <TableCell style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>Proveedor</TableCell>
            <TableCell style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>Nombre</TableCell>
            <TableCell style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>Stock</TableCell>
            <TableCell style={{ backgroundColor: '#ABABAD', fontWeight: 'bold'}}>Precio</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow>
              <TableCell>{row[0]}</TableCell>
              <TableCell>{row[1]}</TableCell>
              <TableCell>{row[2]}</TableCell>
              <TableCell>{row[3]}</TableCell>
              <TableCell>{row[4]}</TableCell>
              <TableCell>
                <Button variant="contained" color="primary" style={{ color: 'red' }}>
                  Ver Detalles {/* Texto del bot√≥n */}
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </div>
  );
}
